import React from 'react';
import './App.css';
import Header from './components/header.js';

function App() {
  return (
    <>
      <Header />
      <div style={{ display: 'inline' }}>.</div>
      <div style={{ display: 'inline' }}>.</div>
      <div style={{ display: 'inline' }}>.</div>
    </>
  );
}

export default App;
